import React from "react";
import { Carousel } from "react-responsive-carousel";
function Hero() {
  return (
    <div className="flex flex-col w-full items-center justify-items-center">
      <div className="flex flex-col  w-10/12 items-center justify-items-center">
        <div className="w-10/12 items-center mt-4"></div>
        <div className="relative">
          <Carousel>
            <img src="images/carousel-1.jpeg" alt="carousel-1" />
            {/* <p className="legend">Legend 1</p> */}

            <img src="images/carousel-2.jpeg" />
            {/* <p className="legend">Legend 2</p> */}
          </Carousel>
        </div>
      </div>
    </div>
  );
}

export default Hero;
